  false,\n\t\"url\": null,\n\t\"notes\": \"An estimated 70,000 acre feet(AF) of water
  are needed annually to maintain 14,000 acres of marsh currently administered by
  the Stillwater NWR. The 1993 water projections forecast a 100% irrigation delivery
  year starting on March 22 ending in mid-November. This equates to approximately
  21,000- 31,500 AF of return flows to maintain 6,300-14,000 acres at SNWR based on
  projected water storage and releases at Lahontan Reservoir. Due to prolonged drought
  conditions, return flows are expected to be significantly delayed once irrigation
  season commences in late March. Stillwater NWR presently, has available 3,510 AF
  of acquired water.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
